import ReactDOM from "react-dom";
import {Circle} from "react-leaflet";

import React, { useState } from 'react';
import PropTypes from 'prop-types';


function MarkerRadius(props) {
    const [kilometers,setKilometers] = useState(1);

    const useEffect = () =>{
        console.log(props);
    }
    const changeKilometers = (event) => {
        setKilometers(event.target.value);
      };
    return (
        <div>
            <Circle center={[props.center[0],props.center[1]]} radius={1000} />
            <div className="range-operations">
                <input
                    type='range'
                    min={1}
                    onChange={changeKilometers}
                    max={400}
                    step={1}
                    value={kilometers}
                    className='custom-slider'>
                </input>
            </div>
        </div>
    );
}

export default MarkerRadius;
